import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div>
      <div id="img-container">

      </div>
      <div id="search-bar">
        <input type="text" id="search-input"></input>
        <button onClick={search}>Search</button>
      </div>
    </div>

  );
}


function search() {
  var myQuery = window.encodeURI(document.getElementById('search-input').value)
  console.log(myQuery);
  if (myQuery != '') {
    window.location.assign("https://www.google.com/search?q=" + myQuery);
  }
}

function randomImage() {
  document.getElementById('img-container').innerHTML = '<img src="https://source.unsplash.com/random/1920x1080>';
}
export default App;
